import{_ as t,o as e,c as a,e as o}from"./chunks/framework.mYMQfzZG.js";const r="/assets/2.zifsjgma.jpg",s="/assets/1.0ZYnk1xO.jpg",n="/assets/255A7793.BMipKv4F.jpg",D=JSON.parse('{"title":"Коптер","description":"Центр Молодёжного Инновационного Творчества","frontmatter":{"title":"Коптер","description":"Центр Молодёжного Инновационного Творчества","date":"2018-09-10","icon":"logo.png","cover":"1.jpg","url":"https://ru.coex.tech/cmit","tel":"+7 (926) 357-21-21","email":"shishkin@coex.tech","city":"г. Москва","place":"Технополис «Москва»","address":"Волгоградский проспект, дом 42к5","coord":[55.710384234435615,37.725180385361],"vk":"cmitcopter","youtube":"https://youtu.be/J8K1uDLf8R4","status":"open"},"headers":[],"relativePath":"workshop/catalog/kopter/index.md","filePath":"workshop/catalog/kopter/index.md"}'),p={name:"workshop/catalog/kopter/index.md"},i=o('<h3 id="о-нас" tabindex="-1">О нас <a class="header-anchor" href="#о-нас" aria-label="Permalink to &quot;О нас&quot;">​</a></h3><p>ЦМИТ «Коптер» был создан на экспертной базе ООО «Коптер Экспресс», лидера на рынке образовательной летающей робототехники и разработчика мультироторных беспилотных летательных аппаратов для образования, автономного мониторинга территорий и доставки грузов.</p><p>На базе Центра проводятся развивающие мероприятия по конструированию, сборке, настройке, пилотированию и программированию квадрокоптеров, а также хакатоны.</p><p><img src="'+r+'" alt=""></p><h3 id="курсы" tabindex="-1">Курсы <a class="header-anchor" href="#курсы" aria-label="Permalink to &quot;Курсы&quot;">​</a></h3><p>Курсы рассчитанные как на детей, так и на взрослых, и дают учащимся понимание как устроен беспилотник, каковы особенности его управления, как его сделать своими руками и как грамотно совершить полет, управляемый или автономный.</p><h3 id="мероприятия" tabindex="-1">Мероприятия <a class="header-anchor" href="#мероприятия" aria-label="Permalink to &quot;Мероприятия&quot;">​</a></h3><p>Ваш ребёнок ещё не определился со сферой своих интересов в инновационном творчестве? Специально для Вас на базе ЦМИТ «Коптер» проводятся образовательные отраслевые мероприятия, благодаря которым ребёнок сможет попробовать себя в разнообразных направлениях индустрии беспилотников и найти для себя наиболее притягательную деятельность.</p><h3 id="оборудование" tabindex="-1">Оборудование <a class="header-anchor" href="#оборудование" aria-label="Permalink to &quot;Оборудование&quot;">​</a></h3><p>Если у Вас есть навык работы с оборудованием, но нет к нему доступа, то мы можем предоставить удобное рабочее место и возможность воспользоваться лазерным резаком, 3д-принтером, фрезерным станком с ЧПУ, плоттером, токарным станком.</p><p><img src="'+s+'" alt=""></p><h3 id="рабочее-место-в-цмит-«коптер»" tabindex="-1">Рабочее место в ЦМИТ «Коптер» <a class="header-anchor" href="#рабочее-место-в-цмит-«коптер»" aria-label="Permalink to &quot;Рабочее место в ЦМИТ «Коптер»&quot;">​</a></h3><p>Для прошедших обучение в ЦМИТе по нашим программам — специальные условия, вплоть до бесплатного использования оборудования для одобренных проектов.</p><h3 id="_3d-принтеры" tabindex="-1">3D принтеры <a class="header-anchor" href="#_3d-принтеры" aria-label="Permalink to &quot;3D принтеры&quot;">​</a></h3><p>3Д печать уже плотно вошло в проектную деятельность, а 3Д-принтер уже настолько привычное оборудование, как и обычный принтер. Для печати в основном мы применяем PLA пластик — экологичный, не токсичный и биоразлагаемый материал.</p><p><em>Стоимость: 3д-печать пластиком PLA 20 руб./грамм</em></p><p><strong>3D принтер DIY Prusa i3 Steel BiZon</strong> Построение реального объекта по созданному на компьютере образцу 3D модели в формате STL, методом послойного «наращивания» материала.</p><p><strong>3D принтер Prusa i3 Steel BiZon DUO</strong> Построение реального объекта по созданному на компьютере образцу 3D модели в формате STL, методом послойного «наращивания» материала с возможностью поочерёдной печати двумя материалами.</p><p><strong>3D принтер 3DQ Prism Pro V2</strong> Послойное создание физического объекта по цифровой 3D-модели. Prism Pro V2 — 3D-принтер профессионального уровня, выполненный по схеме «дельта-робот». Принтер оснащен автоматической калибровкой, подогреваемым рабочим столом, закрытой рабочей камерой и системой охлаждения экструдера. Prism Pro печатает модели до 400 мм в диаметре и до 800 мм высотой, с минимальной толщиной слоя от 0,05 мм. Благодаря двустороннему обдуву модели при печати и механизму регулирования поджатия нити, принтер печатает всеми основными видами пластика: ABS, PLA, Watson, HIPS и FLEX.</p><p><strong>3D принтер Prusa i3 Steel BiZon (боуден)</strong> Изготовление комплектующих для беспилотных летательных аппаратов.</p><h3 id="фрезерные-и-токарные-станки" tabindex="-1">Фрезерные и токарные станки <a class="header-anchor" href="#фрезерные-и-токарные-станки" aria-label="Permalink to &quot;Фрезерные и токарные станки&quot;">​</a></h3><p>Беспилотные Авиационные Системы испытывают значительные нагрузки в воздухе и для сохранения приемлемой массы и прочности требуют применение современных материалов, таких как карбон, стеклотекстолит и др. Для обработки этих материалов с высокой точностью и скоростью применяются Фрезерные станки с ЧПУ. Для обработки тел вращения — токарный станок.</p><p><em>Стоимость:</em> <em>Фрезерование на станке с ЧПУ 2000 руб./час (не включая материал)</em> <em>Работа на токарном станке 1500 руб./час (не включая материал)</em></p><p><strong>Станок фрезерно-гравировальный портальный вертикального типа с ЧПУ Cutmaster CM-D960S</strong> Построение реального объекта по созданному на компьютере образцу 3D модели в формате STL, методом послойного «наращивания» материала.</p><p><strong>Wattsan A1 6090</strong> Фрезерно-гравировальный станок с ЧПУ WATTSAN A1 6090 — один из самых экономичных и практичных станков. Станок выполняет резку и гравировку дерева, МДФ, ДСП, акрила, оргстекла, ПВХ, композита, алюминия. Также с помощью WATTSAN A1 6090 можно выполнять фрезерную 3D-резку.</p><p><strong>Станок фрезерный BF16 Vario</strong> Введение во фрезерные работы</p><p><strong>Настольный Токарный станок Metalmaster MML 1830V</strong> Предназначен для токарной обработки деталей. Имеется быстрозажимной трехкулачковый патрон 100 мм, с тавотницей на торцевой поверхности которая позволяет оперативно смазывать кулачки в труднодоступных местах.</p><h3 id="лазерные-резаки" tabindex="-1">Лазерные резаки <a class="header-anchor" href="#лазерные-резаки" aria-label="Permalink to &quot;Лазерные резаки&quot;">​</a></h3><p>Благодаря лазерным резакам открывается бескрайний горизонт применения для своих проектов таких материалов как фанера, поликарбонат, орг. стекло и др. Помимо резки на оборудовании можно выполнить гравировку.</p><p><em>Стоимость:</em> <em>Лазерная резка фанеры от 29 руб./метр при толщине материала 3 мм (Пластик, Оргстекло оговариваются индивидуально)</em> <em>Цена гравировки 5 руб/кв.см.</em></p><p><strong>Станок для лазерной резки Kamach II 1060 AS</strong> Построение реального объекта по созданному на компьютере образцу 3D модели в формате STL, методом послойного &quot;наращивания&quot; материала.</p><p><strong>Wattsan micro 0203</strong> Аппарат подключается к компьютеру через USB порт и поддерживает программы CorelDraw и AutoCAD. Лазерный гравер поддерживает следующие графические форматы: BMP, PLT, CDR, DXF, AI, SVG и другие.</p><h3 id="плоттеры" tabindex="-1">Плоттеры <a class="header-anchor" href="#плоттеры" aria-label="Permalink to &quot;Плоттеры&quot;">​</a></h3><p>Распечатать чертежи к диплому или защите проекта — легко, когда под рукой широкоформатный плоттер! По нашему опыту оценки и судейства чужих проектов мы столкнулись с восприятием проектов из фанеры — как скворечников, именно поэтому мы предлагаем сделать выкройку на самоклеящейся плёнке и обклеить свой проект. Или же любые наклейки самой интересной формы.</p><p><em>Стоимость:</em> <em>Широкоформатная печать на плоттере 400 руб./кв.м. при 10% заполнении</em> <em>Печать наклеек на режущем плоттере 1000 руб./кв.м.</em></p><p><strong>Струйный плоттер HP Designjet T520</strong> Плоттер HP Designjet T520 36in незаменим в дизайнерском бюро или на производственном предприятии. Модель, осуществляющая печать в максимальном формате А0, подходит для печати масштабных проектов сооружений, интерьеров и схем оборудования. Встроенная память объемом 1 Гб обеспечивает быструю обработку данных. HP DesignJet T520 36in работает с листовыми и рулонными носителями, что позволяет выбрать предпочтительный вариант для поставленных задач.</p><p><strong>Режущий плоттер Mimaki CJV150-107</strong> Плоттер Mimaki CJV150−107 незаменим в дизайнерском бюро или на производственном предприятии. Модель, осуществляющая печать в максимальном формате А0, подходит для печати масштабных проектов сооружений, интерьеров и схем оборудования.</p><p><em>Паяльные станции и осциллограф</em></p><p>Современная электроника достаточна требовательна к температурным режимам пайки — специально для этого мы выбрали качественные паяльные станции с высокой точностью удержания температуры и осциллограф для возможности проверки работоспособности компонентов и схем.</p><p><strong>Паяльная станция YIHUA 853D</strong> Паяльная станция — инструмент для ремонта, монтажа, демонтажа и пайки самых различных предметов различных размеров: от крупных систем проводов до мельчайших микросхем. Управление паяльной станцией производится при помощи микроконтроллера, что обеспечивает высокую точность нагрева и предполагает профессиональное использование данной модели.</p><p><strong>Настольный осциллограф Hantek DSO-5102P</strong> Производить замеры электрической частоты, импульсных и амплитудных колебаний</p><p><img src="'+n+'" alt=""></p>',42),l=[i];function c(h,m,d,g,u,_){return e(),a("div",null,l)}const k=t(p,[["render",c]]);export{D as __pageData,k as default};
